import React from 'react'
import './style/style.css'
import sheep from '../assests/images/sheep.png'

function Sheep() {
  return (
    <div className='sheep_viwer'>
        <img src={sheep} className='sheep_viwer--sheepIMG' alt='sheep'/>
    </div>
  )
}

export default Sheep
